import React from 'react';
import './style.css';
import Navbar from './Navbar';
import Footer from './Footer';
import {Button} from '@material-ui/core';
import { Link } from 'react-router-dom';
import logo from './images/logo2.png';
import { makeStyles,createMuiTheme, } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import { green } from '@material-ui/core/colors';

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '20rem',
    },
  },
}));


const Sign_in_forgot = () => {
    
  const classes = useStyles();

  return (
    
    <div className="container1">
      <Navbar />
        <h2>Sign into CoralOS</h2>
        <div className="container8">
            <h3>Trouble Logging In?</h3>
            <a className="p5">Enter your email or phone and we'll send you a link to </a>
            <a className="p3">get back into your account.</a>
        </div>
        <a className="p5">get back into your account.</a>
        <form className={classes.root} noValidate autoComplete="off">
            <TextField id="outlined-basic" placeholder="Email Address" variant="outlined" size="small"/>
        
        </form>
        <form className={classes.root} noValidate autoComplete="off">
            <TextField id="outlined-basic" placeholder="Password" variant="outlined" size="small"/>
        </form>
      
        <div className="checkbox1">
          <input type='checkbox' />
          <label>Remember me</label>
        </div>
        <Link to='/home'  className="link1"><Button className="button2">Sign in</Button></Link>
        <div className="linkdiv1">
            <Link to='/Sign_up'  className="link1">Forgot your password ?</Link>
            <br/>
            <Link to="/Sign_up" className="link2">Create an account</Link>
        </div>
        <Footer/>
    </div>
  );
};

export default Sign_in_forgot;
